import React from "react";

function Form(){
    return(
        <div>
            <form>
                <div>
                    <p>CARDHOLDER NAME</p>
                    <input type="text"></input>
                </div>
                <div>
                <p>CARD NUMBER</p>
                <input type="number"></input>
            </div>
            </form>
        </div>
    );
}

export default Form;
